import React from "react";
import "./App.css";
import Navbar from "./components/navbar";

function App() {
  return (
    <div className="App">
      <Navbar />
      <header className="App-header">
        <p>Edit and save to reload.</p>
      </header>
    </div>
  );
}

export default App;
